Initially I thought YNYN (since only 3 types of images are excluded in /images/) because:

https://learn.microsoft.com/en-us/azure/static-web-apps/configuration
"In the following example, requests for certain routes in the /images folder and all files in the /css folder are excluded from returning the fallback file."

JSON
{
 "navigationFallback": {
 "rewrite": "/index.html",
 "exclude": ["/images/*.{png,jpg,gif}", "/css/*"]
 }
}

However I changed to YYYN, because of
https://learn.microsoft.com/en-us/azure/static-web-apps/configuration#example-configuration-file

So this depends on which Microsoft article they are trying to test us.

